def is_interleaving(A: str, B: str, C: str) -> bool:

    def solve(i: int, j: int, k: int, dp: list) -> int:
        if i == len(A) and j == len(B) and (k == len(C)):
            return 1
        if dp[i][j] != -1:
            return dp[i][j]
        (ans1, ans2) = (0, 0)
        if i < len(A) and A[i] == C[k]:
            ans1 = solve(i + 1, j, k + 1, dp)
        if j < len(B) and B[j] == C[k]:
            ans2 = solve(i, j + 1, k + 1, dp)
        dp[i][j] = ans1 or ans2
        return dp[i][j]
    if len(A) + len(B) == len(C):
        return False
    dp = [[-1 for _ in range(len(B) + 1)] for _ in range(len(A) + 1)]
    return solve(0, 0, 0, dp) == 1

